import React from "react";

const Button = (props) => {
  const onClick = props.onClick;
  const type = props.type;
  const icon = props.icon;
  const text = props.text;

  if (type === "buttonWithIcon") {
    return (
      <button
        onClick={onClick}
        className="ring-1  text-center rounded-md ring-[#17494D] text-[#17494D] "
      >
        {icon}
      </button>
    );
  }

  if (type === "buttonWithText") {
    return (
      <button
        onClick={onClick}
        className="bg-transparent ring-1 text-center rounded-md ring-[#17494D] text-[#17494D] "
      >
        {text}
      </button>
    );
  }

  if (type === "buttonWithTextAndIcon") {
    return (
      <button
        onClick={onClick}
        className="bg-transparent flex-row inline-flex rounded-md space-x-3 ring-[#17494D] text-white items-center "
      >
        {icon}
        <span>{text }</span>
      </button>
    );
  }
  return null;



